package com.example.usage;

import com.seed.nullableOptional.SeedNullableOptionalClient;
import com.seed.nullableOptional.resources.nullableoptional.requests.ListUsersRequest;

public class Example {
    public static void main(String[] args) {
        SeedNullableOptionalClient client = SeedNullableOptionalClient
            .builder()
            .build();

        client.nullableOptional().listUsers(
            ListUsersRequest
                .builder()
                .limit(1)
                .offset(1)
                .includeDeleted(true)
                .sortBy("sortBy")
                .build()
        );
    }
}

